import{p as e}from"./csv.helper.d14e8c45.js";import{t}from"./date.helper.6ae3fc87.js";import{d as n,f as a}from"./index.d7dc1ff6.js";const s=192,o=[{topic:"Assessment",category:[{name:"Assessment",template:[{detail:{th:"Globish ทำการเปิดแบบทดสอบบทให้ท่านเรียบร้อยแล้ว \nสามารถทำแบบทดสอบได้ถึง วัน/เดือน/ปี ขอบคุณค่ะ",en:"Globish has successfully opened the assessment. \nYou have until date/month/year to complete the assessment. \n\nThank you."}}]},{name:"Request Assessment",template:[{detail:{th:"Globish ทำการเปิดแบบทดสอบของท่านอีกครั้งแล้ว \nท่านสามารถทำแบบทดสอบได้ถึง วันที่/เดือน/ปี ขอบคุณค่ะ",en:"Globish has reopened your assessment. \nYou have until Date/Month/Year to complete the assessment. \n\nThank you."}}]},{name:"The evaluation results",template:[{detail:{th:"หากท่านมีการเรียนมากกว่า 5 ครั้ง Globish ไม่แนะนำให้ท่านทำแบบทดสอบ เนื่องจากผลการทำแบบทดสอบจะไม่สามารถประเมินได้อย่างแม่นยำ",en:"Globish does not recommend taking the assessment if you have studied more than five times because the evaluation results will be inaccurate."}}]}]},{topic:"Certification",category:[{name:"Request Certification",template:[{name:"กรณียังไม่ทำแบบทดสอบ",detail:{th:"ใบรับรองผลการเรียนจะได้รับหลังจากที่ท่านทำแบบทดสอบหลังเรียน (Post test) เสร็จสิ้น ภายใน 7-14 วัน ทาง Globish จะดำเนินการออกใบรับรองผลการเรียนให้ โดยท่านสามารถดาวน์โหลดได้ผ่านทางหน้าเว็บไซต์ \nขอบคุณค่ะ",en:"The certificate will be issued after you have completed the post-test within 7-14 days. You can download it from the website. \n\nThank you."}},{name:"กรณีทำแบบทดสอบแล้ว",detail:{th:"ท่านสามารถดาวน์โหลดใบรับรองผลการเรียน โดยคลิกหัวข้อ เมนู > อื่นๆ > ประวัติการทำแบบทดสอบ > ใบรับรองผลการเรียน \nขอบคุณค่ะ",en:"You can download the certificate by clicking Menu > Other > Assessment > Certificate.  \n\nThank you."}}]}]},{topic:"Complaint/Suggestion",category:[{name:"Suggestion",template:[{detail:{th:"Globish ได้รับข้อความของคุณเรียบร้อยแล้ว ขอบคุณสำหรับข้อเสนอแนะ ทางเราจะนำไปพัฒนา และปรับปรุงให้ดีขึ้นค่ะ \n\nขอบคุณค่ะ",en:"Globish has received your message. Thank you for your valuable feedback. We strive for this type of feedback to help us continue to improve. \n\nThank you very much."}}]}]},{topic:"Coach",category:[{name:"Coach Suggestions",template:[{detail:{th:"Globish ขออนุญาตแนะนำโค้ช สำหรับคอร์ส ....... ดังนี้ ... \nขอบคุณค่ะ",en:"Globish suggests coaches for the..... course that follows..... \n\nThank you."}}]},{name:"Coache Schedule",template:[{detail:{th:"โค้ชจะทำการเปิดตารางเรียนในวัน ... เวลา ... \nขอบคุณค่ะ",en:"The coach will update the class schedule on ... ... time. \n\nThank you."}}]},{name:"Coach Feedback",template:[{detail:{th:"Globish ได้รับข้อความของคุณเรียบร้อยแล้ว ขอบคุณสำหรับข้อเสนอแนะ ทางเราจะนำไปพัฒนา และปรับปรุงให้ดีขึ้นค่ะ \nขอบคุณค่ะ",en:"Globish has received your message. Thank you for your valuable feedback. We strive for this type of feedback to help us continue to improve. \n\nThank you very much."}}]}]},{topic:"Course/Ticket",category:[{name:"Request Extend Ticket",template:[{name:"Pro",detail:{th:"ทาง Globish ดำเนินการขยายระยะเวลาวันหมดอายุตั๋วเรียนให้ท่านเรียบร้อยแล้วค่ะ โดยสามารถขยายได้เฉพาะตั๋วประเภทคลาสเรียนส่วนตัว (Private class) และตั๋วประเภทกลุ่ม  (Discussion class) ท่านสามารถใช้งานได้ถึง วันที่/เดือน/ปี \n\nขอบคุณค่ะ",en:"Globish has already extended your course ticket's expiration date, which can only be used for Private and Group Discussion classes. \nYou can access course until the date/month/year specified. \n\nThank you."}},{name:"Kids",detail:{th:"ทาง Globish ดำเนินการขยายวันหมดอายุตั๋วเรียนให้ท่านเรียบร้อยแล้วค่ะ ท่านสามารถใช้งานได้ถึง วันที่/เดือน/ปี ทาง Globish แนะนำให้ท่านทำการจองเรียนล่วงหน้าก่อนถึงวันหมดอายุอีกครั้งนะคะ \n\nขอบคุณค่ะ",en:"Globish has already extended your course ticket's expiration date. \nYou can access course until the date/month/year specified. \nWe recommend scheduling your classes ahead of time before they expire. \n\nThank you."}}]},{name:"Lost Ticket",template:[{detail:{th:"เนื่องจากตั๋วเรียนของท่านหมดอายุไปในวันที่/เดือน/ปี ทาง Globish ดำเนินการขยายวันหมดอายุให้ท่านใหม่เรียบร้อยเเล้ว ท่านสามารถใช้งานได้ถึง วันที่/เดือน/ปี ทาง Globish แนะนำให้ท่านทำการจองเรียนล่วงหน้าก่อนถึงวันหมดอายุอีกครั้งนะคะ \n\nขอบคุณค่ะ",en:"Globish has already extended your course ticket's expiration date because it expired on the date/month/year specified. You can access course until the date/month/year. \nWe recommend scheduling your classes ahead of time before they expire. \n\nThank you."}}]},{name:"Tickets are not about to expire. We are still unable to extend the time.",template:[{detail:{th:"ท่านยังสามารถใช้ตั๋วเรียนในการจองเรียนได้จนถึง วันที่/เดือน/ปี หากต้องการขยายอายุตั๋วเรียน กรุณาติดต่ออีกครั้ง เมื่อตั๋วเรียนของท่านจะหมดอายุภายในสัปดาห์นั้น \n\nขอบคุณค่ะ",en:"You can use your ticket to reserve classes until the date/month/year specified. \nIf you need to extend your course ticket, please contact us again when it expires within that week. Thank you."}}]}]},{topic:"Discussion Class",category:[{name:"Schedule",template:[{detail:{th:"ท่านสามารถจองเรียน Discussion class ได้ผ่านทางด้านหน้าเว็บไซต์ โดยคลิกไปที่ 'จองเรียน' เลือกจองประเภทตั๋วเรียน 'Discussion class' ท่านสามารถเลือกหัวข้อและช่วงเวลาที่มีการเปิดสอนตามความสนใจ \n\n(สำหรับตารางเรียน Discussion class จะมีการอัพเดตทุกสัปดาห์ในวันศุกร์ช่วงเย็นจนถึง 2 ทุ่ม โดยท่านจะได้รับการแจ้งเตือนผ่าน Line notify)",en:"You can book a Group Discussion class on the website by clicking 'Book class' and then selecting 'Discussion class.' Based on your interests, you can choose topics and times that are convenient for you. \n\n(The schedule for Group, Discussion classes will be updated weekly on Friday evenings until 8 p.m. You will receive a notification via Line notify.)"}}]}]},{topic:"Globish Plus",category:[{name:"How to access",template:[{detail:{th:"ท่านสามารถเข้าใช้งาน Globish Plus ได้ที่หน้าเว็บไซต์ โดยคลิกที่ 'เข้าใช้งาน' หากท่านใช้งานผ่าน smartphone แนะนำให้ดาวน์โหลด App Globish Plus ใน App store หรือ Play store สามารถเข้าสู่ระบบด้วยอีเมล์และรหัสผ่านที่ลงทะเบียนกับทาง Globish และหากท่านต้องการเข้าเรียน Live instruction ผ่าน App Globish Plus ให้ท่านดาวน์โหลด App BlueJeans เพิ่มเติม ระบบจะมีการเชื่อมต่อเมื่อท่านเข้าคลาสเรียน",en:"Globish Plus can be accessed via the website by clicking on 'Access.' \nIf you have a smartphone, it is recommended that you download App Globish Plus from the App or Play store. \nLog in using your registered email address and password. \nIf you want to take the Live instruction via App Globish Plus, you must first download App BlueJeans. When you enter the classroom, the system will be activated."}}]}]},{topic:"Master Class",category:[{name:"Material",template:[{detail:{th:"ท่านสามารถดาวน์โหลดเอกสารการเรียน master class ได้ที่ด้านหน้าเว็บไซต์โดยคลิก > เพิ่มเติมในกล่องคลาสเรียน",en:"On the website, click > 'Detail' next to the 'Enter room' button to download master class materials."}}]},{name:"Schedule",template:[{detail:{th:"ท่านสามารถจองเรียน Master Class ได้ผ่านทางด้านหน้าเว็บไซต์ โดยคลิกไปที่ 'จองเรียน' เลือกจองประเภทตั๋วเรียน 'Master class'\n\n(คลาสเรียน master class จะมีตามหัวข้อเป็นประจำทุกสัปดาห์ในวันเสาร์ เวลา 20:00 น.)",en:"You can book a Master class on the website by clicking 'Book class' and then selecting 'Master class.'\n\n(The schedule for, Master class will be updated weekly on Friday evenings until 8 p.m.)"}}]}]},{topic:"Device",category:[{name:"Device Check",template:[{detail:{th:"ท่านสามารถตรวจสอบอุปกรณ์การใช้งานเบื้องต้นได้ที่หน้าเว็บไซต์ผ่านช่องทาง> เมนู > อื่นๆ > ตรวจสอบอุปกรณ์",en:"On the website, you can check your device setup by going to > Menu > Other > Device Check."}}]},{name:"Report Issue",template:[{detail:{th:"",en:""}}]}]},{topic:"Receipt",category:[{name:"Request a receipt and tax invoice",template:[{detail:{th:"Globish ดำเนินการจัดส่งใบเสร็จ/ใบกำกับภาษีเรียบร้อยแล้ว \nกรุณารอรับตามที่อยู่ที่ท่านได้แจ้งไว้กับเจ้าหน้าที่ ขอบคุณค่ะ",en:"Globish has successfully sent the receipt/tax invoice. It will be delivered to the address you provided with your support request. \n\nThank you."}}]}]},{topic:"Speaking Lab",category:[{name:"Booking the class",template:[{detail:{th:"ท่านสามารถจองเรียน Speaking Lab ได้ผ่านทางด้านหน้าเว็บไซต์ โดยไปที่ English Speaking Lab แล้วคลิกที่ 'จองเรียน' ท่านสามารถเลือกหัวข้อและช่วงเวลาที่มีการเปิดสอนตามความสนใจ \n\n(สำหรับตารางเรียน Speaking Lab จะมีการอัพเดตทุกสัปดาห์ในวันศุกร์ช่วงเย็นตั้งแต่ 16.00 น.เป็นต้นไป โดยท่านจะได้รับการแจ้งเตือนผ่าน Line notify)",en:"You can reserve a Speaking Lab class from the website by going to 'English Speaking Lab' and clicking on 'Book' Based on your interests, you can choose topics and times that are convenient for you. \n\n(The Speaking Lab schedule will be updated weekly on Friday from 16.00 onwards. You will receive a notification via Line notify.)"}}]}]},{topic:"How to use",category:[{name:"How to book the class",template:[{detail:{th:"ท่านสามารถจองเรียนผ่านทางหน้าเว็บไซต์และเลือกประเภทตั๋วเรียน โดยสามารถจองคลาสเรียนได้อย่างน้อย 1 ชั่วโมง และหากต้องการยกเลิกคลาสเรียน ท่านสามารถยกเลิกได้อย่างน้อย 3 ชั่วโมงก่อนถึงเวลาเรียนค่ะ",en:"The website allows you to reserve classes and choose the type of tickets you want. You can book a class at least 1 hour in advance. Furthermore, you can cancel the class at least 3 hours before it begins."}}]},{name:"How to download materials",template:[{detail:{th:"ท่านสามารถดาวน์โหลดเอกสารการเรียนผ่านหน้าเว็บไซต์ โดยคลิกหัวข้อ 'เมนู' และเลือก 'เอกสารการเรียน' ขอบคุณค่ะ",en:"On the website, you can download learning materials by going to the 'Menu' and selecting 'Learning Materials.\n\nThank you.'"}}]},{name:"How to attend the class",template:[{detail:{th:"ท่านสามารถเข้าเรียนผ่านหน้าเว็บไซต์ โดยปุ่ม 'เข้าเรียน' ของท่านจะปรากฎเป็นสีส้มให้ท่านสามารถกดเข้าคลาสเรียนได้ 10 นาทีก่อนถึงเวลาที่ท่านจองคลาสเรียนเอาไว้ ขอบคุณค่ะ",en:"You can join the class on the website. The 'Enter room' button will turn orange, and you will be able to enter your classroom 10 minutes before the class begins. \n\nThank you."}}]}]},{topic:"PLE (Play Learn Earn)",category:[{name:"Asking for help (Rules and choosing rewards)",template:[{detail:{th:'ท่านสามารถดูของรางวัลแต่ละ Challenge ได้ผ่านทางหน้าเว็บไซต์ โดยคลิกที่แบนเนอร์ "Globish Kids ชวนน้องพิชิต Challenge" และเลือกเมนู "กติกา" หรือท่านสามารถคลิกได้ที่นี่ https://bit.ly/3vVBl5x ขอบคุณค่ะ  \n\nPlay Learn Earn เป็นกิจกรรมการสะสมการใช้ตั๋วเรียนคลาสเรียนส่วนตัวตามเงื่อนไขที่กำหนดเพื่อพิชิตของรางวัลแต่ละ Challenge ดังนี้  \n\nChallenge 1 ท่านจะต้องสะสมการใช้ตั๋วเรียนให้ครบ 20 ใบพอดี ในระยะเวลา 60 วันแรกนับตั้งแต่การเข้าเรียนคลาสเรียนส่วนตัวครั้งแรกของคอร์สที่เข้าร่วมกิจกรรม \nChallenge 2 ท่านจะต้องสะสมการใช้ตั๋วเรียนให้ครบ 10 ใบพอดี ในระยะเวลา 30 วันถัดจากชาเลนจ์ที่ 1 \nChallenge 3 ท่านจะต้องสะสมการใช้ตั๋วเรียนให้ครบ 10 ใบพอดี ในระยะเวลา 30 วันถัดจากชาเลนจ์ที่ 2 \nChallenge 4 ท่านจะต้องสะสมการใช้ตั๋วเรียนให้ครบ 10 ใบพอดี ในระยะเวลา 30 วันถัดจากชาเลนจ์ที่ 3 \n\n ท่านสามารถเข้าร่วมกิจกรรมได้ฟรี ไม่เสียค่าใช้จ่าย โดยท่านมี 2 เส้นทางในการพิชิตของรางวัล ท่านจะต้องเลือกเส้นทางใด เส้นทางหนึ่ง ดังต่อไปนี้ \n1. การเลือกรับของรางวัลย่อย ท่านจะได้รับของรางวัลย่อยหลังจากพิชิต Challenge ผ่าน โดยจะได้รับ Challenge ละ 1 ชิ้น \n2. การเลือกรับของรางวัลใหญ่ ท่านจะได้รับของรางวัลใหญ่ 1 ชิ้น หลังจากพิชิต Challenge ครบทั้ง 4 Challenge \n\nท่านสามารถดูรางวัลเกี่ยวกับกิจกรรม Play Learn Earn เพิ่มเติมได้ที่นี่ https://bit.ly/3vVBl5x',en:"You can view the rewards of each Challenge from the website by clicking on the banner 'Globish Kids ชวนน้องพิชิต Challenge' and selecting the menu 'กติกา' or visit this link: https://bit.ly/3vVBl5x Thank you.\n\nPlay Learn Earn is an activity in which you collect private class tickets by meeting the requirements and winning the rewards for each Challenge as follows: \n\nChallenge 1 requires you to collect 20 tickets within the first 60 days of starting the participating course.\n\nChallenge 2 requires you to collect 10 tickets within 30 days of completing Challenge 1.\n\nChallenge 3 requires you to collect 10 tickets within 30 days of completing Challenge 2.\n\nChallenge 4 requires you to collect 10 tickets within 30 days of completing Challenge 3.\n\nThe event is free to attend. There are two ways to get the reward, and you must choose one of them:\n\n1. Choosing a sub-reward. After completing a Challenge, you will receive a sub-reward, one per Challenge.\n2. Choosing a big reward. After completing all four Challenges, you will receive one big reward.\n\nMore information on the Play Learn Earn activities can be found here. https://bit.ly/3vVBl5x"}}]},{name:"Asking for help (how to view the rewards of challenges)",template:[{detail:{th:'ท่านสามารถดูของรางวัลแต่ละ Challenge ได้ผ่านทางหน้าเว็บไซต์ โดยคลิกที่แบนเนอร์ "Globish Kids ชวนน้องพิชิต Challenge" และเลือกเมนู "ของรางวัล" หรือท่านสามารถคลิกได้ที่นี่ https://bit.ly/3vVBl5x \n\nและหากท่านต้องการแจ้งของรางวัลที่ต้องการกับเจ้าหน้าที่ สามารถติดต่อ Student Support โทร 063-189-9451 \n\nขอบคุณค่ะ',en:"You can view the rewards of each Challenge from the website by clicking on the banner 'Globish Kids ชวนน้องพิชิต Challenge' and selecting the menu 'ของรางวัล' or visit this link: https://bit.ly/3vVBl5x \n\nIf you want to inform the expected rewards, please contact Student Support at 063-189-9451. \n\nThank you."}}]},{name:"Asking for help (Shipping)",template:[{detail:{th:"ของรางวัลจากกิจกรรม Play Learn Earn จะถูกจัดส่งตามรอบการจัดส่งที่เจ้าหน้าที่ได้แจ้งกับท่านเอาไว้ โดยปกติจะใช้เวลา 15-30 วันหลังจากทาง Globish ประกาศรายชื่อผู้พิชิต Challenge ผ่านประจำสัปดาห์  \n\nหากไม่ได้รับของรางวัลจากกิจกรรม Play Learn Earn ตามรอบการจัดส่งที่เจ้าหน้าแจ้งไวท่านสามารถติดต่อ Student Support โทร 063-189-9451 \n\nnขอบคุณค่ะ",en:"The Play Learn Earn activity rewards will be delivered according to the delivery cycle that the staff has informed you of. It usually takes 15-30 days after Globish announces the Weekly Challenge Pass winners. If the reward from the Play Learn Earn activity is not received within the delivery cycle specified by the staff, please contact Student Support at 063-189-9451. \n\nThank you."}}]},{name:"Asking for help (Announcement listed)",template:[{detail:{th:'Globish จะประกาศรายชื่อผู้ที่สามารถพิชิต Challenge จากกิจกรรม Play Learn Earn ในทุกวันศุกร์ของสัปดาห์ที่ 2 และ 4 ของเดือน ท่านสามารถดูประกาศรายชื่อผ่านทางหน้าเว็บไซต์ โดยคลิกที่แบนเนอร์ "Globish Kids ชวนน้องพิชิต Challenge" และเลือกเมนู "ประกาศรางวัล" หรือท่านสามารถคลิกได้ที่นี่ https://bit.ly/3vVBl5x  \n\nขอบคุณค่ะ',en:'Every Friday of the second and fourth weeks of the month, Globish will announce the winners of the Play Learn Earn Challenge. The website contains a list of announcements by selecting the banner "Globish Kids ชวนน้องพิชิต Challenge" and clicking on the menu "ประกาศรางวัล" or visit this link: https://bit.ly/3vVBl5x \n\nThank you.'}}]}]},{topic:"Others",category:[{name:"other",template:[{detail:{th:"Globish ได้รับข้อความของคุณเรียบร้อยแล้ว ขอบคุณสำหรับข้อเสนอแนะ ทางเราจะนำไปพัฒนา และปรับปรุงให้ดีขึ้นค่ะ \n\nขอบคุณค่ะ",en:"Globish has received your message.\nThank you for your valuable feedback.\nWe strive for this type of feedback to help us continue to improve.\n\nThank you very much."}}]}]}],i=(n,a)=>{const s=n.filter((e=>"action"!==e.key)),o=a.map((n=>`"${s.map((a=>"createdAt"===a.key?t(n.createdAt,"DD/MM/YYYY HH:mm"):"dueDate"===a.key?t(n.dueDate,"DD/MM/YYYY HH:mm"):e(n,a.key)||"-")).join('","')}"`));return[`"${s.map((e=>e.label)).join('","')}"`,...o].join("\n")},l=e=>o.find((t=>e===t.topic));function h(){const e=n(),{catchResponse:t}=a();return{getAllFeedback:async n=>{const a=await e.get("/Feedbacks",{params:n});return t(a)},getFeedbackById:async n=>{const a=await e.get(`/Feedbacks/${n}`);return t(a)},createFeedback:t=>e.post("/Feedbacks",t),editFeedback:(t,n)=>e.put(`/Feedbacks/${t}`,n)}}export{s as M,i as c,l as s,h as u};
